"]="fire_dimension_2024_flaming_fox",["is_for_sale"]=false,["origin_entry"]={["full_origin"]="Fire Dimension 2024",["year"]=2024,["origin"]="Fire Dimension",["robux"]=false,["obtainable"]=false,["origin_items"]={"fire_dimension_2024_burnt_bites_bait","fire_dimension_2024_baked_alaska_bait"}}}},["Food"]={{["anims"]={["hold"]="IceCreamHold"},["typechecked"]=true,["lure_pet_reveal_effect"]="Lures2023EmberRevealEffect",["image"]="rbxassetid://16273266097",["category"]="food",["tool"]="LuresBaitPopup",["is_lure_bait"]=true,["lure_time"]=600,["model_handle"]="FireDimension2024BakedAlaskaBait",["id"]="fire_dimension_2024_baked_alaska_bait",["lure_pet_reveal_sound"]="LureFirePetReveal",["name"]="Baked Alaska Bait",["contentpack"]="FireDimension2024",["rarity"]="ultra_rare",["kind"]="fire_dimension_2024_baked_alaska_bait",["is_for_sale"]=false,["custom_tooltip_description"]=[[For use at a Lure\nPet (Ultra Rare): 90%\nPet (Legendary): 10%]]},{["anims"]={["hold"]="IceCreamHold"},["typechecked"]=true,["lure_pet_reveal_effect"]="Lures2023EmberRevealEffect",["image"]="rbxassetid://16273265763",["category"]="food",["tool"]="LuresBaitPopup",["is_lure_bait"]=true,["lure_time"]=600,["model_handle"]="FireDimension2024BurntBitesBait",["id"]="fire_dimension_2024_burnt_bites_bait",["lure_pet_reveal_sound"]="LureFirePetReveal",["name"]="Burnt Bites Bait",["contentpack"]="FireDimension2024",["rarity"]="common",["kind"]="fire_dimension_2024_burnt_bites_bait",["is_for_sale"]=false,["custom_tooltip_description"]=[[For use at a Lure\nBucks: 75%\nAge Potion: 10%\nAccessories/Toys: 10%\nPet (Ultra Rare): 4.5%\nPet (Legendary): 0.5%]]}}},["NPCs"]={["fire_dimension_2024_tim_1"]={["name"]="Tim",["dialogs"]={{{["length"]=2.5,["text"]="TIMS! LOOK! THEY MADE IT BACK!!"},{["length"]=4,["text"]="We have been COOKING and TESTING and... NOTHING!!"},{["length"]=4,["text"]="Until now! Yes, yes. Recipes vary slightly, pay close attention!"},{["length"]=4,["text"]="You'll need Pyro Pears, Sparkling Blaze Berries, AND Magma Mangos."},{["length"]=3.5,["text"]="Put them together and cook just past the point of human consumption."},{["length"]=4,["text"]="Inedible to us, irresistible to these flaming creatures. Pets!"},{["length"]=3,["text"]="You call them pets. Come on! FIND THE FRUIT!"}}}},["fire_dimension_2024_tim_2"]={["name"]="Tim",["dialogs"]={{{["length"]=2,["text"]="Ah! You made it!"},{["length"]=3,["text"]="The creatures here!! They're wild, but they CAN be made pets."},{["length"]=4.5,["text"]="We spent the last 6 MONTHS in the Fire Dimension. We fed them so many things... too many."},{["length"]=5,["text"]="Listen to this! Burnt Bites Bait. They love that stuff, it'll Lure them right into your home."},{["length"]=3,["text"]="Burning Bunny, Flaming Fox, Wildfire Hawk -- those are Ultra-rare. Easily traceable."},{["length"]=4,["text"]="The Volcanic Rhino, that one's the Legendary beast. It might just make you question your luck."},{["length"]=3,["text"]="The secret is... fire. SO. MUCH. FIRE!"}}}},["fire_dimension_2024_tim_3"]={["name"]="Tim",["dialogs"]={{{["length"]=2,["text"]="Ha! You'll never believe it."},{["length"]=4,["text"]="During our travels, we found a recipe for the most potent bait of them all."},{["length"]=3,["text"]="No creature can resist the temptation of the Baked Alaska Bait!"},{["length"]=3,["text"]="Perfectly carmelised on the top, it feels like Fire Dimension itself."},{["length"]=4,["text"]="For a Robux fee, we'll cook up the bait for you that GUARANTEES a pet."},{["length"]=3,["text"]="What do you think? You like those odds?"}}}},["fire_dimension_2024_tim_4"]={["name"]="Tim",["dialogs"]={{{["length"]=3,["text"]="Look around! This island's fire properties pulse through every bit of grass,"},{["length"]=2.5,["text"]="every leaf on a bush, the air, clouds, and even the rocks! "},{["length"]=3,["text"]="Pick up this Magma Mango... sniff it. A little bit like... mango, right? With a hint of charred firewood? "},{["length"]=3.5,["text"]="Walk around, stretch your legs. Pick a bunch more, and craft Burnt Bites Bait with Tim up there! "},{["length"]=2,["text"]="Might not be the tastiest for you, though... "}}}},["fire_dimension_2024_tim_5"]={["name"]="Tim",["dialogs"]={{{["length"]=2,["text"]="You ever heard of cold plunges? I do the opposite!"},{["length"]=3,["text"]="I'm conditioning myself to build a lava resistance. "},{["length"]=3,["text"]="It's day 167 of plunging in progressively hotter and hotter milk. "},{["length"]=4,["text"]="Day 89 was the perfect hot cocoa temperature. STARTIN' TO FEEL IT!"},{["length"]=3.5,["text"]="I knew it the second I saw it, when we got here. That I would SWIM IN THIS LAVA! "},{["length"]=2,["text"]="Listen here. DO NOT. DO THIS. AT HOME!! "},{["length"]=2.5,["text"]="I'm a professional!!! Oooof... ouch! "}}}}}},["VehicleShop2022"]={["InventorySubDB"]={["Transport"]={{["rarity"]="legendary",["typechecked"]=true,["id"]="vehicle_shop_2022_gyrocopter",["image"]="rbxassetid://8925104785",["name"]="Gyrocopter",["category"]="transport",["contentpack"]="VehicleShop2022",["kind"]="vehicle_shop_2022_gyrocopter",["is_for_sale"]=false,["colorable"]=true},{["rarity"]="common",["cost"]=400,["id"]="vehicle_shop_2022_motorbike",["typechecked"]=true,["image"]="rbxassetid://8859231811",["colorable"]=true,["category"]="transport",["contentpack"]="VehicleShop2022",["kind"]="vehicle_shop_2022_motorbike",["is_for_sale"]=true,["name"]="Motorbike"},{["rarity"]="common",["cost"]=4000,["id"]="vehicle_shop_2022_plane",["typechecked"]=true,["image"]="rbxassetid://8859231943",["colorable"]=true,["category"]="transport",["contentpack"]="VehicleShop2022",["kind"]="vehicle_shop_2022_plane",["is_for_sale"]=true,["name"]="Classic Airplane"},{["rarity"]="common",["cost"]=3500,["id"]="vehicle_shop_2022_helicopter",["typechecked"]=true,["image"]="rbxassetid://8859231666",["colorable"]=true,["category"]="transport",["contentpack"]="VehicleShop2022",["kind"]="vehicle_shop_2022_helicopter",["is_for_sale"]=true